import React from 'react';
import Navbar from '../navbar';
import { Grid } from '@material-ui/core';
import FormRegister from './formRegister';

const Home = props => {
    return(
        <div>
            <Navbar />
            
            <Grid
			container
			direction="row"
			justify="center"
			alignItems="center">
				
			<FormRegister />

			</Grid>
        </div>
    );
}

export default Home;
